x = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\nstart = time.time()\n# py-bokeh is needed if you wanna see the perf report\nwith performance_report(filename=\"dask-report.html\"):\n\n    # Construct a lazy task graph\n    cpt = Derivee(gt, 1).mean()\n\n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n\n    # Sign contract\n    arrays.validate_contract()\n    del gt\n    # Print the result, note that \"s\" is a future object, to get the result of the computation,\n    # we call `s.result()` to retreive it.\n    # Write the results\n    with open(\"results.log\", \"a\") as f:\n        f.write(str(client.compute(s).result()))\n\nprint(\"{:&lt;21}\".format(\"EST_ANALYTICS_TIME:\") + \"{:.5f}\".format(time.time()-start))\n\n\nprint(\"Done\", flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"below":[{"id":"1122"}],"center":[{"id":"1125"},{"id":"1129"}],"min_border_bottom":50,"name":"task_stream","renderers":[{"id":"1135"}],"sizing_mode":"stretch_both","title":{"id":"1114"},"toolbar":{"id":"1130"},"toolbar_location":"above","x_range":{"id":"1111"},"x_scale":{"id":"1118"},"y_range":{"id":"1112"},"y_scale":{"id":"1120"}},"id":"bk-task-stream-plot","subtype":"Figure","type":"Plot"},{"attributes":{"color_mapper":{"id":"1151"},"coordinates":null,"formatter":{"id":"1177"},"group":null,"label_standoff":12,"location":[0,0],"major_label_policy":{"id":"1449"},"ticker":{"id":"1178"}},"id":"1176","type":"ColorBar"},{"attributes":{"overlay":{"id":"1024"}},"id":"1021","type":"BoxZoomTool"},{"attributes":{},"id":"1013","type":"BasicTicker"},{"attributes":{},"id":"1234","type":"ResetTool"},{"attributes":{"start":0},"id":"1185","type":"DataRange1d"},{"attributes":{"label":{"value":"write"},"renderers":[{"id":"1340"}]},"id":"1363","type":"LegendItem"},{"attributes":{"line_color":"#1f77b4","x":{"f
